import 'bootstrap/dist/css/bootstrap.min.css';
import { Card } from 'react-bootstrap';
const cardData = [
    { title: 'Card 1', image: 'https://picsum.photos/200/300', description: 'Description for card 122' },
    { title: 'Card 2', image: 'https://picsum.photos/200/300', description: 'Description for card 2222' },
    { title: 'Card 3', image: 'https://picsum.photos/200/300', description: 'Description for card 333' },
    { title: 'Card 4', image: 'https://picsum.photos/200/300', description: 'Description for card 433' },
    { title: 'Card 5', image: 'https://picsum.photos/200/300', description: 'Description for card 445' }
  ];
  


//   const cardsData = [
//     {title: "Card 1", content: "Content for card 111"},
//     {title: "Card 2", content: "Content for card 2"},
//     {title: "Card 3", content: "Content for card 3"},
//     {title: "Card 4", content: "Content for card 4"},
//     {title: "Card 5", content: "Content for card 5"}
//   ];
  
  function CardList() {
    return (
      <div>
        {cardData.map((card, index) => (
          <Card className='d-flex' key={index}>
              <Card.Img variant="top" className='img-fluid w-25' src={card.image} />
            <Card.Body>
              <Card.Title>{card.title}</Card.Title>
              <Card.Text>{card.content}</Card.Text>
            </Card.Body>
          </Card>
        ))}
      </div>
    );
  }
  


export default CardList;
